    //method
    }
}

Instantiation
$newObject = new ClassName();

Access Properties
echo $newObject -> $variable;

Access Methods
$newObject -> funcName();


Method call can be embedded in a string using braces {}.echo "Welcome to {$object->get_location( )}"



Assign Properties
