connect the database by instantiating a new PDO object.
try {
 $dbh = new PDO("mysql:host=localhost;dbname=MYID","MYID","MYPASSWORD");
}catch (Exception $e) {
 die("ERROR: Couldn’t connect. {$e ->getMessage()}");
