Fetch an array of object from database and encode into JSON for JavaScript using json_encode() directly will omit all private variables of an object. The following interface should be implemented in the object's class definition.// Class Definition
class User implements JsonSerializable
{
  private $firstname;
  private $lastname;
  function __construct(…){…}
  public function jsonSerialize()
  {
      //json_encode calls this method and get all private variables.
      return get_object_vars($this);    }
}
//to use json_encode:
$userlist = [];
while ($row=$stmt->fetch()) {
  $user = new User($row["firstname"], $row["lastname"]);
  array_push($userlist, $user);
}
echo json_encode($userlist);


